<script>
import {getProlistByareAndtype, getPqContentByPqname} from '@/api'

export default {
    props: ['index'],
    data() {
        return {
            project: -1,
            projectList: [],
            projectValue: {}
        }
    },
    async created() {
        const {data} = await getProlistByareAndtype()
        this.projectList = data
    },
    watch: {
        async index(index) {
            this.getPqContentByPqname(index)
        }
    },
    methods: {
        async mouseover(index) {
            this.getPqContentByPqname(index)
            this.$emit('changeSvg', index)
        },
        mouseleave() {
            this.$emit('changeSvg', -1)
        },
        changeProject(index) {
            this.project = index
        },
        async getPqContentByPqname(index) {
            const list = ['漆水河两岸黄土台塬沟壑区', '漆沮河下游河谷川道区', '赵氏河流域黄土台塬沟壑区', '漆水河上游黄土丘陵沟壑区', '漆水河上游黄土丘陵沟壑区', '宜君县黄土丘陵沟壑区', '沮河上游黄土丘陵沟壑区']
            const {data} = await getPqContentByPqname(list[index])
            this.projectValue = data[0]
        },
        changeItem(item) {
            this.$router.push({
                name: 'project', query: {proid: item.PRO_ID}
            })
        }
    }
}
</script>


